import Offers from './offers.js';
import './nav.css';
import click1 from './click.js';
function Nav(){
    return (
        <>
        <div className='nav-box'>
          <div className='left-div'><p className='logo'>Anuj Singh...</p></div>
          <div className='right-div'>
            <a href="#" className='btn'>Home</a>
            <a href="#" className='btn'>Contact</a>
            <a href="#" className='btn'>Skills</a>
            <a href="#" className='btn'>Projects</a>
            <a href="#" className='btn' onClick={click1()}>offer</a>
          </div>
        </div>
        </>
    );
}
export default Nav;
